import React from "react";
import './Styles/Header.css'
function Header(){

    return(
        <header>
            <a className="logo" href="#"><img src="#"/></a>
            <div className="login">  
                <a  href="#">Login</a>
                <a href="#">Cadastrar</a>
            </div>
        </header>
    )
}

export default Header
